'use strict';

angular.module('main', []).controller('wanderController', function ($scope, $http, $window) {

  $scope.owned = [];
  $scope.borrowing = [];

  $scope.submitItem = function (item) {
    if (item) {
      $http({
        method: 'POST',
        url: '/items/',
        data: { item: item }
      }).then(function (res) {
        console.log('sent!');
      });
      $scope.item = '';

      $http({
        method: 'GET',
        url: '/items/'
      }).then(function (update) {
        update.data.map(function (item) {
          $scope.owned.push(item.itemname);
        });
      });
    } else {
      console.log('invalid string');
    }
  };
});
